import React from 'react';
import {Image} from 'react-native';
import {createBottomTabNavigator} from 'react-navigation-tabs';
import BookDonateScreen from '../screens/BookDonateScreen';
import BookRequestScreen from '../screens/BookRequestScreen';

export const appTabNavigator = createBottomTabNavigator({
    donatebook:{
        screen:BookDonateScreen,
        navigationoption:{
            tabBarIcon:<Image source = {require("../assets/adaptive-icon(1).png")} style = {{width:20, height:20}}/>,
            tabBarIcon:"donate book"
        }
    },
    requestbook:{
        screen:BookRequestScreen,
        navigationoption:{
            tabBarIcon:<Image source = {require("../assets/one-punch-man.png")} style = {{width:20, height:20}}/>,
            tabBarIcon:"request book"
        }
    }
})
